import React from 'react';

class RoomScreen extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <h1>Room Code: {this.props.gameState.roomID}</h1>
        <h2>Players:</h2>
        <ul>
          <li>{this.props.gameState.clientID}</li>
        </ul>
      </div>
    )
  }
}

export default RoomScreen;
